import { useNavigate } from "react-router-dom"
import { useState } from "react";

export default function SignIn(){
    const [name, setName] = useState(0);
    const nav = useNavigate();
    

    return(
        <div className = "wrapper">
            <div className = "signin">
            
                <h2 id ="signin-text">  SIGN IN  </h2> 
            
                <form>
                    <label id="userlabel"> <strong> {name} </strong> </label>
                    <input type="text" id = "username" name="first"></input>
                    <label id="passlabel"> <strong> Password </strong> </label>
                    <input type="text" id = "password" name="last"></input>
                    <button id = "signin" type="submit" onClick={ ChangeSign} > SIGN IN </button>
                </form>
                    

                <hr id = "signup" ></hr>
                <h2 id ="signup-text"> SIGN UP </h2>
            <button id="signupb" onclick = "window.location.href='signUp.html'"> CREATE ACCOUNT </button>
            </div>
        </div>
    )
}

function ChangeSign() {
    setName()
    
}
